import React from 'react';

import { makeStyles } from '@material-ui/core/styles';
import { Grid } from '@material-ui/core';

import LoginForm from '../../components/Login/LoginForm';

const useStyles = makeStyles((theme) => ({
    container: {
        height: '100vh',
        padding: '0px 30px',
        display: 'flex',
        alignItems: 'center',
        alignContent: 'center',
        justifyContent: 'center',
        flexWrap: 'wrap',
        background: 'linear-gradient(0, rgba(110, 110, 110, 0.5) 0%, rgba(110, 110, 110, 0.5) 12.5%,rgba(101, 101, 101, 0.5) 12.5%, rgba(101, 101, 101, 0.5) 25%,rgba(93, 93, 93, 0.5) 25%, rgba(93, 93, 93, 0.5) 37.5%,rgba(84, 84, 84, 0.5) 37.5%, rgba(84, 84, 84, 0.5) 50%,rgba(76, 76, 76, 0.5) 50%, rgba(76, 76, 76, 0.5) 62.5%,rgba(67, 67, 67, 0.5) 62.5%, rgba(67, 67, 67, 0.5) 75%,rgba(59, 59, 59, 0.5) 75%, rgba(59, 59, 59, 0.5) 87.5%,rgba(50, 50, 50, 0.5) 87.5%, rgba(50, 50, 50, 0.5) 100%),linear-gradient(90deg, rgb(65, 65, 65) 0%, rgb(65, 65, 65) 12.5%,rgb(76, 76, 76) 12.5%, rgb(76, 76, 76) 25%,rgb(86, 86, 86) 25%, rgb(86, 86, 86) 37.5%,rgb(97, 97, 97) 37.5%, rgb(97, 97, 97) 50%,rgb(108, 108, 108) 50%, rgb(108, 108, 108) 62.5%,rgb(119, 119, 119) 62.5%, rgb(119, 119, 119) 75%,rgb(129, 129, 129) 75%, rgb(129, 129, 129) 87.5%,rgb(140, 140, 140) 87.5%, rgb(140, 140, 140) 100%)',
    },
}));

const Login = () => {

    const classes = useStyles();

    return (
        <Grid container>

            <Grid className={classes.container} item xs={12}>

                <LoginForm />

            </Grid >

        </Grid>
    );
};

export default Login;
